                <img src={logo} alt="logo" />


            </Logo>

            <Link to="/products" style={{ margin: 10, float: "right" }}>products</Link>

            <ThemeButton onClick={handleToggle}> {buttonText}</ThemeButton>



        </div>
    );
}



export default NavBar;
